import React, { useEffect } from "react";
// import { Link } from "react-router-dom";

function Contact() {
    useEffect(() => {
        document.title = 'Contacts us';
    });
    return (
        <>
            <section class="u-align-left u-clearfix u-palette-1-light-1 u-section-1" id="sec-23dd">
                <div class="u-clearfix u-sheet u-sheet-1">
                    <h1 class="u-align-center u-text u-text-default u-text-1">Contact Us</h1>
                    <p class="u-align-center u-text u-text-2">We would love to answer your queries or doubts regarding our services or
        request a quote. Eager to hear from you, let`s talk.</p>
                </div>
            </section>
            <section class="u-clearfix u-section-2" id="sec-3273">
                <div class="u-clearfix u-sheet u-sheet-1">
                    <div class="u-align-center u-container-style u-group u-radius-20 u-shape-round u-white u-group-1">
                        <div class="u-container-layout u-container-layout-1"></div>
                    </div>
                </div>
            </section>
        </>
    )
}

export default Contact
